import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
export default function CompanyHome({ userData, companyName }) {
  const [userList, setUserList] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  useEffect(() => {
    const token = window.localStorage.getItem("token");

    fetch(`http://localhost:5000/getAllUser?token=${token}`, {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        if (data.status === "ok") {
          setUserList(data.data);
        }
        setLoading(false);
      });
  }, []);

  const logout = () => {
    window.localStorage.clear();
    window.location.href = "/login";
  };

  return (
    <div>
   <h5>Welcome  {companyName}</h5>
   <i
          className="fa-solid fa-user-pen"
           onClick={() => navigate("/updateCompany", { state: userData })}
        ></i>
      <table style={{ width: 500 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>User Type</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {loading ? (
            <tr>
              <td>Loading...</td>
            </tr>
          ) : (
            userList.map((user) => (
              <tr key={user._id}>
                <td>{user.fname}</td>
                <td>{user.email}</td>
                <td>{user.userType}</td>
                <td></td>
              </tr>
            ))
          )}
        </tbody>
      </table>

      <button className="btn btn-primary" onClick={logout}>
        Logout
      </button>
    </div>
  );
}
